('42eba048-f871-11e6-a12a-f46e471cb539', 'RIU PALACE CABO VERDE', '', 'info.capeverde@renovaspa.com', 'Paula Casas', '08:00:00', '20:00:00', '', 1, '2017-02-21 00:00:00', 0, 0, 0),
('44fda1ce-f452-11e6-935c-349b705c7f66', 'RIU PALACE PARADISE ISLAND', '6307 Casino Drive Paradise Island, Paradise Island, Bahamas', 'info@renovaspa.com', 'Paula Casas', '08:00:00', '20:00:00', '6307 Casino Drive Paradise Island, Paradise Island, Bahamas', 1, '2017-02-16 00:00:00', 0, 0, 0),
('76fc9dd8-03a8-11e7-8418-deadbe60ee62', 'GRAND PALLADIUM KANTENAH RESORT & SPA', '', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', 'Grand Palladium Kantenah Resort & Spa  ', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7713a688-03a8-11e7-8418-deadbe60ee62', 'GRAND PALLADIUM RESORT & SPA', '', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', 'Grand Palladium Colonial Resort & Spa    ', 1, '2017-03-07 00:00:00', 0, 0, 0),
('772a4d33-03a8-11e7-8418-deadbe60ee62', 'GRAND PALLADIUM RIVIERA RESORT & SPA', '', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', 'Grand Palladium Riviera Resort & Spa  ', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7740f29d-03a8-11e7-8418-deadbe60ee62', 'GRAND PALLADIUM WHITE SAND RESORT & SPA', '', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', 'Grand Palladium White Sand Resort & Spa   ', 1, '2017-03-07 00:00:00', 0, 0, 0),
('77589c28-03a8-11e7-8418-deadbe60ee62', 'HOTEL RIU PLAZA PANAMA', '50th Street - 6th floor<br> Bella Vista, Panama City<br>', 'info@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>from Monday through Saturday.</p>\r\n<p>From 11:00 am to 7:00 pm on Sundays and holidays.<br /> Open to the hotel guests and general public.</p>\r\n<p>The Fitness Center is open from 6:00 am to 9:00 pm and only available for the hotel guests.&nbsp;</p>\r\n<p><br /> We do not close at any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p><span><br /></span></p>\r\n<h3><span style=\"font-size: 1.17em;\">SPA FACILITIES</span></h3>\r\n<p><span style=\"font-size: 1.17em;\"><br /></span></p>\r\n<p>Luxury and distinction is the perfect definition for this City Spa.&nbsp;</p>\r\n<p align=\"justify\">Located on the 6th floor of the Riu Panama Plaza it is an oasis of tranquility in the heart of the financial center of Panama, featuring 4 treatment rooms: 3 single and 1 double room for couples services.</p>\r\n<p>The spa includes a beauty salon that offers pampering services like hair cuts and treatments, nails treatments and waxing services among others.</p>\r\n<p>&nbsp;</p>\r\n<p>This is the Beauty Salon equipment:&nbsp;</p>\r\n<div align=\"justify\">\r\n<ul>\r\n<li>\r\n<div align=\"left\">2 dressing tables</div>\r\n</li>\r\n<li>\r\n<div align=\"left\">1 hair washbasin</div>\r\n</li>\r\n<li>\r\n<div align=\"left\">2 manicure tables</div>\r\n</li>\r\n<li>\r\n<div align=\"left\">1 pedicure deluxe armchair</div>\r\n</li>\r\n</ul>\r\n<p>Within the Spa facilities lies a luxurious relaxation area&nbsp;for guests to lounge before or after their spa treatments.&nbsp;&nbsp;</p>\r\n<p>In addition to this, male and female steam baths are offered for all spa users and as part of the &ldquo;all-inclusive&rdquo; services for hotel guests.</p>\r\n<p><strong><br /></strong></p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>The gym includes the following equipment:</p>\r\n<ul>\r\n<li>4 Treadmills</li>\r\n<li>2 Elliptic trainer</li>\r\n<li>2 Exercise Bikes</li>\r\n<li>1 Stepper</li>\r\n<li>1 Bicep and Triceps Machine</li>\r\n<li>1 Gluts Machine</li>\r\n<li>1 Adjustable Ab Bench</li>\r\n<li>1 Pectoral, Fly/Rear delta machine</li>\r\n<li>1 Multi station Machine<br /><br /></li>\r\n</ul>\r\n</div>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('77709485-03a8-11e7-8418-deadbe60ee62', 'NOW RIVIERA CANCUN', '', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', 'Now riviera Cancun    ', 1, '2017-03-07 00:00:00', 0, 0, 0),
('77998f25-03a8-11e7-8418-deadbe60ee62', 'RIU BACHATA CLUBHOTEL', 'Bahía de Maimón, Riu Hotels Calle Caribeña Puerto Plata, Dominican Republic', 'info.dominicanrepublic@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We are located inside Riu Bachata Club Hotel and serve the guests <br />at Riu Merengue Village and &nbsp;Riu Merengue Garden as well.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We are open 365 days a year.</p>\r\n<p><br /><br /><br /><br /><br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>Renova Spa provides a beautiful and natural getaway from modern life stress.</p>\r\n<p>A broad range of spa services such as signature massages, facials, body treatments, special therapies and packages are offered in our four indoor treatment rooms, one of which is a double room for couple treatments.</p>\r\n<p>&nbsp;</p>\r\n<p>Our approach to relaxation goes beyond spa pampering.</p>\r\n<p>We also offer a variety of nail treatments and a sauna area, which are ideal for achieving the body and mind balance.</p>\r\n<p>&nbsp;</p>\r\n<p>Massage services are also offered at our 3 beach pavilions, where the sound of crashing waves and the soft ocean breeze make the perfect scenario for relaxation.</p>\r\n<p>&nbsp;</p>\r\n<p>Let us make your vacation just unforgettable!&nbsp;</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('77bf19f5-03a8-11e7-8418-deadbe60ee62', 'RIU BAMBU HOTEL', 'Hoteles Riu Playa Macao, Punta Cana, Dominican Republic', 'info.dominicanrepublic@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><span><br />The Riu Bambu does not offer an in-house spa, but massages and<br />hair braids are available at the beach pavillion.<br />Additionally, Riu Bambu guests have access to the spa at the <a href=\"https://www.renovaspa.com/abouthotel.php?id=75\">Riu Palace Bavaro.</a><span><br />We do not close at any holidays.</span></span></p>\r\n<p><br /><br /><br /><br /><br /></p>\r\n<p><strong>BEACH PAVILION</strong></p>\r\n<p>Do not miss a moment from the gorgeous Caribbean Ocean view. <br /><br />Relax and enjoy the sound of crashing waves with a unique massage at Renova Spa\'s beach pavilion.<br /><br /><br />A broad range of spa services such as body treatments,facials and massages including specially designed packages, salon and nail services can be enjoyed at the <a href=\"https://www.renovaspa.com/abouthotel.php?id=75\">Riu Palace Bavaro</a>&nbsp; Renova Spa to make your vacation just unforgettable!</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('77e04a74-03a8-11e7-8418-deadbe60ee62', 'RIU CANCUN HOTEL', 'Boulevard Kukulcán Km.<br> Hotel Zone - Cancun <br>Quintana Roo - Mexico, CP 77500', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>The spa is inside the Hotel Riu Canc&uacute;n.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We are open 365 days a year.</p>\r\n<p>&nbsp;<br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>Going out from the lobby you will find a stair by the Restaurant La Toscana, which leads to the most relaxing area of the hotel, our beautiful Renova Spa.</p>\r\n<p>This small, but elegant and fully refurbished spa, offers four cabins, one of which is double - sized for couple services. <br />Delicate aromas, soft music and candlelight will guide you on a calm journey while receiving massages, body wraps or facial treatments.</p>\r\n<p>Do not miss our special packages to make this vacation an unforgettable one! <br />Guests who like being outdoors can enjoy massages in our poolside delightful beach gazebo with an astonishing view of our Caribbean Sea!</p>\r\n<p>The spa has a modern beauty salon offering the high-quality full services such as haircuts, settings, manicure and pedicures, among others.</p>\r\n<p>The salon is equipped with:</p>\r\n<ul>\r\n<li>2 dressing tables (for haircuts and styling)&nbsp;</li>\r\n<li>1 hair washing station&nbsp;</li>\r\n<li>2 manicure tables&nbsp;</li>\r\n<li>2 pedicure chairs&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>The gym is available free of charge for guests of the all-inclusive program and includes:</p>\r\n<ul>\r\n<li>&nbsp;3 Treadmills&nbsp;</li>\r\n<li>1 Stepper&nbsp;</li>\r\n<li>1 Stairmaster&nbsp;</li>\r\n<li>1 Bike&nbsp;</li>\r\n<li>1 Biceps Row&nbsp;</li>\r\n<li>1 Chest Press&nbsp;</li>\r\n<li>1 Leg curl&nbsp;</li>\r\n<li>1 Leg Extension&nbsp;</li>\r\n<li>1 Lat- biceps-triceps-machine&nbsp;</li>\r\n<li>1 Reclining Bench&nbsp;</li>\r\n<li>1 bench for free weights&nbsp;</li>\r\n<li>Pilates Balls&nbsp;</li>\r\n<li>Yoga mats.</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('77f80174-03a8-11e7-8418-deadbe60ee62', 'RIU CARIBE HOTEL', 'Boulevard Kukulcán, 5.5 Z.H.<br>Km. 5.5, Hotel Zone - Cancun,<br>Quintana Roo<br>Mexico, CP 77500', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />The spa is inside the Hotel Riu Caribe.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We are open 365 days a year.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3>&nbsp;</h3>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>The spa is decorated with colorful details and fine wood furniture, creating an atmosphere of sophistication and tranquility.</p>\r\n<p>Facilities include five cabins for massages, body and facial treatments.</p>\r\n<p>Guests who like being outdoors can enjoy therapeutic massages and braiding services in our poolside pavilion or delightful beach palapa.</p>\r\n<p>The spa has a modern beauty salon offering the high-quality full services such as haircuts, settings, manicure and pedicure, among others.</p>\r\n<p>The salon is equipped with:</p>\r\n<ul>\r\n<li>2 dressing tables&nbsp;</li>\r\n<li>1 hair washing station&nbsp;</li>\r\n<li>2 manicure tables&nbsp;</li>\r\n<li>2 pedicure chairs on a wooden platform &nbsp;&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;The spa is adjacent to an outdoor relaxation area featuring an open air Jacuzzi.</p>\r\n<p>The sauna and steam room for ladies and gentlemen, and the gym are available free of charge for guests on the all-inclusive program.</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Includes the following exercise equipment</p>\r\n<ul>\r\n<li>1 Elliptic trainer&nbsp;</li>\r\n<li>2 Treadmills&nbsp;</li>\r\n<li>1 Leg Extension/Leg Multicurl Gym </li>\r\n<li>1 Byceps Curl</li>\r\n<li>1 Multiuse station&nbsp;</li>\r\n<li>1 Bench for abdominals&nbsp;</li>\r\n<li>Dumbbell racks</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('780f376c-03a8-11e7-8418-deadbe60ee62', 'RIU CORAL IN MORNE BRABANT', 'RIU Club Hotel & ResortCoastal Road, Le Morne, Mauritius', 'info.mauritius@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>We\'re located inside Hotel Riu Coral in Morne Brabant.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>The Fitness Centre&nbsp;is open from 9:00 am to 7:30 pm.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p><br /><br /><br /><br /><br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>To be used by guests from the Hotel Riu Le Morne, the Hotel Riu Creole and the Hotel Riu Coral. This Renova Spa is located at the Hotel Riu Coral.</p>\r\n<p>A broad range of spa services such as body treatments, facials and massages including exquisite Ayurveda Specialties and local techniques are offered in the six treatment rooms, three of which are double for couple treatments, to make your vacation just unforgettable!</p>\r\n<p>To wrap up your spa experience, before or after any spa treatment, Renova Spa features a relaxation area, where you will be able to enjoy a Jacuzzi and also a hammam located inside the changing rooms for ladies and gentlemen respectively.</p>\r\n<p>The spa has a modern beauty salon offering high-quality full services such as haircuts, settings, different types of manicures and pedicures, among others.</p>\r\n<p>The salon equipment includes:</p>\r\n<ul>\r\n<li>2 dressing tables&nbsp;</li>\r\n<li>1 hair washbasin&nbsp;</li>\r\n<li>2 manicure stations&nbsp;</li>\r\n<li>1 pedicure station&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>The gym includes the following exercise equipment:</p>\r\n<ul>\r\n<li>2 Treadmills with Led monitor and USB&nbsp;</li>\r\n<li>2 Exercise Bikes with Led monitor and USB&nbsp;</li>\r\n<li>1 Elliptic trainer with Led&nbsp;monitor&nbsp;and USB&nbsp;</li>\r\n<li>1 Multi Gym Station: Gym Ball/Stability Ball&nbsp;</li>\r\n<li>7 Localized Strength Equipment</li>\r\n<li>1 Set of Medicine Balls&nbsp;</li>\r\n<li>1&nbsp;High Quality&nbsp;Kettle Bell&nbsp;</li>\r\n<li>High Quality rubberized dumbbells with chrome bar&nbsp;</li>\r\n<li>Yoga Mats&nbsp;</li>\r\n<li>Fitness Matt&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>The gym and humid area are free.</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7827e09d-03a8-11e7-8418-deadbe60ee62', 'RIU -EMERALD BAY HOTEL', 'Av. Sábalo-Cerritos #3404<br> Zona costera cerritos<br> Nuevo Mazatlán - Sinaloa - Mexico<br> ', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />The Spa is located inside the Riu Emerald Bay hotel.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;<br /><br /></p>\r\n<h3>&nbsp;</h3>\r\n<h3>&nbsp;<br /><br /></h3>\r\n<h3><span style=\\\"font-size: 1.17em;\\\"><br /></span></h3>\r\n<h3><span style=\\\"font-size: 1.17em;\\\">SPA FACILITIES</span></h3>\r\n<p>&nbsp;</p>\r\n<p>The Spa is located next to the hotel\\\'s main entrance, its spacious facilities and rustic decoration offers the perfect area to relax.</p>\r\n<p>It features 2 single and 5 double massage rooms where our guests can be delighted with any of our massages, facial, or body wraps.<br />Allow yourself to be swept away through the peaceful music and the soft aromas that create the perfect environment to relief you from all stress.</p>\r\n<p>The luxurious beauty salon is totally equipped to offer the most exotic nail treatments, hair styles and other services such as make up and body waxing.</p>\r\n<p>The salon is equipped with:</p>\r\n<ul>\r\n<li>2 dressing tables&nbsp;</li>\r\n<li>Hair washing station&nbsp;</li>\r\n<li>2 manicure table&nbsp;</li>\r\n<li>2 pedicure chairs on a wooden platform&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Guests can detoxify in the Spa\\\'s dry Sauna or enjoy the thermal benefits of the impressive central Jacuzzi surrounded by columns and lounge in this area before or after their treatments.</p>\r\n<p>These services and the gym are available free of charge for guests on the all-inclusive program.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>The gym is equipped with:</p>\r\n<ul>\r\n<li>3 Treadmills&nbsp;</li>\r\n<li>2 Stationary bicycles&nbsp;</li>\r\n<li>2 Elliptical trainers&nbsp;</li>\r\n<li>5 weight machines for localized muscles&nbsp;</li>\r\n<li>Fitness area with Pilates balls and Yoga rugs&nbsp;</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7855b4a2-03a8-11e7-8418-deadbe60ee62', 'RIU GUANACASTE HOTEL', 'Riu Hotel - Playa Matapalo.Guanacaste - Costa Rica.', 'info.costarica@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We are located inside the Guanacaste.&nbsp;<br />The spa will not be able to make reservations for you by phone.</p>\r\n<p>The Fitness Centre is open from 7:00 am to 8:00 pm.</p>\r\n<p>We do not close at any holidays.</p>\r\n<p><br /><br /><br /><br /><br /></p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>The Renova SPA features 8 treatment rooms, 5 of which are double for couple services, plus a special area for Shiatsu Massages.</p>\r\n<p>Nature lovers will find the perfect place to relax in our garden pavilion with ocean view, offering massages.</p>\r\n<p>Guests of the hotel will enjoy the benefits of a modern wet area facility containing a steam room and a beautiful jacuzzi located in a spacious indoor area equipped with chaises that invite you to lounge before or after your spa treatments.</p>\r\n<p>The spa building also contains a modern beauty salon offering manicures, pedicures, haircuts and hair removal treatments, among many others.<br /><br /></p>\r\n<p>The beauty salon includes the following equipment:</p>\r\n<ul type=\"disc\">\r\n<li>2 dressing tables</li>\r\n<li>1 hair washing station</li>\r\n<li>3 manicure tables</li>\r\n<li>2 pedicure chairs</li>\r\n<li>salon retail area</li>\r\n</ul>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Includes the following exercise equipment:</p>\r\n<ul type=\"disc\">\r\n<li>2 Treadmills</li>\r\n<li>4 Elliptic Trainers</li>\r\n<li>4 Upright Bike</li>\r\n<li>1 Spinning Bike</li>\r\n<li>1 Leg Extension/Leg Curl Multi Gym</li>\r\n<li>1 Chest Press</li>\r\n<li>1 Shoulder Press</li>\r\n<li>1 Seated Row</li>\r\n<li>1 Adjustable Decline/Abdominal Crunch</li>\r\n<li>Yoga Mats</li>\r\n<li>Pilates Balls</li>\r\n<li>Steps</li>\r\n<li>Free Weights (3.30 to 30 pounds)</li>\r\n</ul>\r\n<p>The gym and the humid area are free.</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('786cbdf9-03a8-11e7-8418-deadbe60ee62', 'RIU JALISCO CLUBHOTEL', 'Av. De los Cocoteros S/N LOTE K<br> Condominios Flamingos Vallarta<br>Bahía de Banderas, Nvo. Vallarta<br>México, CP 63732', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We&rsquo;re located inside the Riu Jalisco ClubHotel.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>Located at the pool area, you will find Renova Spa in front of the restaurant &ldquo;La Botana&rdquo;. This elegant and modern spa offers four treatment rooms.</p>\r\n<p>Delicate aromas, soft music and candlelight will guide you on a calm journey while receiving massages, body wraps or facial treatments.</p>\r\n<p>One beautiful wooden outdoor construction for massage services can be found at the beach area.</p>\r\n<p>Do not miss the ocean view while enjoying a relaxing experience during daytime, sunset or moonlight!</p>\r\n<p>The spa has a modern beauty salon offering high-quality full services such as haircuts, settings and nail treatments, among others.</p>\r\n<p>The salon is equipped with:</p>\r\n<ul>\r\n<li>2 dressing tables&nbsp;</li>\r\n<li>1 hair washbasins&nbsp;</li>\r\n<li>2 manicure tables&nbsp;</li>\r\n<li>2 pedicure sets&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>The spa offers an outdoor relaxation area with a Jacuzzi surrounded by a beautiful garden and a separate steam rooms for ladies and gentlemen.</p>\r\n<p>These facilities in conjunction with the gym are available free of charge for guests of the all-inclusive program.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Includes the following exercise equipment:</p>\r\n<ul>\r\n<li>2 Treadmill&nbsp;</li>\r\n<li>1 Stepper&nbsp;</li>\r\n<li>3 Exercise Bikes&nbsp;</li>\r\n<li>6 weight machines for located body areas&nbsp;</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('78848a31-03a8-11e7-8418-deadbe60ee62', 'RIU KARAMBOA CLUBHOTEL', 'Lote HO-1, Urb. Morrinho De BaguinchoPraia de Boca Salina - Boa Vista Cape Verde. ', 'info.capeverde@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We are located inside the Riu Karamboa ClubHotel.&nbsp;<br />The spa will not be able to make reservations for you by phone.</p>\r\n<p>The Fitness Centre is open from 8:00 am to 8:00 pm.</p>\r\n<p>We do not close at any holidays.</p>\r\n<p><br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3>&nbsp;</h3>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>The Boa Vista Renova SPA is located inside the ClubHotel Riu Karamboa.</p>\r\n<p>The island of Boa Vista, the third-largest of the archipelago and the nearest to Africa, surprises visitors with its dune-littered landscape, small oases of palm trees and extensive unspoiled beaches.</p>\r\n<p>The spa mingles with nature and is as much an outdoor experience,&nbsp;as it is an indoor one. <br /><br />Before your treatment, relax in the jacuzzi or sauna and indulge in a massage by the famous Cape Verde Combination massage.</p>\r\n<p>The Spa offers facials for her and for him, body treatments,&nbsp;a complete beauty salon with a complete menu that includes haircut and hair treatments, manicure&nbsp;and pedicure. <br /><br />The relaxing area offer a seaview terrace with chaise long and natural refreshing beverages.</p>\r\n<p>The ideal place for relaxation, inspiration and sublime indulgence.</p>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Includes the following exercise equipment:</p>\r\n<ul type=\\\"disc\\\">\r\n<li>2 Treadmills</li>\r\n<li>2 Ellipticals</li>\r\n<li>3 Stationary bikes</li>\r\n<li>1 Stept</li>\r\n<li>1 Rowiing machine</li>\r\n<li>Multi station trainer</li>\r\n<li>Free weights set from 2 Kg up to 20Kg.</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('789b6f15-03a8-11e7-8418-deadbe60ee62', 'RIU LUPITA HOTEL', 'Av. Xaman-ha, MZA 20, Lote Hotelero 1Playacar, Playa del CarmenQuintana Roo, Mexico.', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We&rsquo;re located inside the Riu Lupita Hotel.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>This small modern spa is located among the lush vegetation of the hotel gardens, which invites you to relax!<br /> It features 2 treatment rooms, where massages, body wraps and facials are offered.</p>\r\n<p>The spa has a beauty salon offering high-quality full services, such as haircuts, settings, manicures and pedicures, among others.</p>\r\n<p>This is the Beauty Salon equipment:</p>\r\n<ul>\r\n<li>2 dressing tables&nbsp;</li>\r\n<li>1 hair washbasins&nbsp;</li>\r\n<li>1 manicure table&nbsp;</li>\r\n<li>1 pedicure chair&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>ECO-MASSAGE PAVILION</strong></p>\r\n<p>Next to the main pool, Renova Spa has created a relaxation area beneath a cozy wooden pavilion.</p>\r\n<p>Enjoy the Caribbean warm weather and the sounds of nature while receiving a relaxing massage in couple or alone!<br /> Nail treatments and hair braiding are also available to get the perfect look under the sun.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>BEACH-MASSAGE PAVILION</strong></p>\r\n<p>At the beach club, we offer massage services and braids at our massage pavilion. <br /> Relax with the sound of the breaking waves as background!&nbsp;</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('78b36690-03a8-11e7-8418-deadbe60ee62', 'RIU MERENGUE GARDEN CLUBHOTEL', 'Bahía de Maimón, Riu Hotels<br>Calle Caribeña, Puerto Plata, <br>Dominican Republic ', 'info.dominicanrepublic@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We are located inside <a href=\"https://www.renovaspa.com/abouthotel.php?id=28\">Riu Bachata Club Hotel</a> and <br />serve the guests at Riu Merengue Village and Riu Merengue Garden as well.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We are open 365 days a year.</p>\r\n<p><br /><br /><br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>Renova Spa provides a beautiful and natural getaway from modern life stress. A broad range of spa services such as signature massages,<br />facials, body treatments, special therapies and packages are offered in our four indoor treatment rooms, one of which is a double room for couple treatments.</p>\r\n<p>Our approach to relaxation goes beyond spa pampering. We also offer a variety of nail treatments and a sauna area, which are ideal for achieving the body and mind balance.</p>\r\n<p>Massage services are also offered at our 3 beach pavilions, where the sound of crashing waves and the soft ocean breeze make the perfect scenario for relaxation.</p>\r\n<p>Let us make your vacation just unforgettable!&nbsp;</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
