('78e9b7ed-03a8-11e7-8418-deadbe60ee62', 'RIU MONTEGO BAY HOTEL', 'Mahoe Bay - Rose Hall - Ironshore P.O.Montego Bay - Jamaica.', 'info.jamaica@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>We are located inside the RIU Montego Bay hotel..</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>&nbsp;</p>\r\n<p>The Fitness Centre is open from 7:00 am to 8:00 pm.</p>\r\n<p>We do not close at any holidays.</p>\r\n<p><br /><br /><br /><br /><br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p><em>To be used by guests from the Riu Montego Bay Hotel and the Riu Palace Jamaica Hotel.</em></p>\r\n<p>Renova Spa offers a luxurious relaxation oasis at the Riu Montego Bay Resort in Jamaica.</p>\r\n<p>Our guests can choose among a broad selection of therapies to experience a unique paradise dream.</p>\r\n<p>Massages, special therapies, body or facial treatments are offered by experienced therapists in any of the 5 single cabins or by couple in the 2 double cabins that the Spa offers.</p>\r\n<p>The facilities include a spacious wet area where 2 Jaccuzis offer indulgent hydrotherapy to enjoy before or after your treatments. Sauna is also available to enjoy a complete spa experience.</p>\r\n<p>Nature lovers will find the perfect place to relax in our two beach pavilions, offering massages and hair braid services.</p>\r\n<p>Let the waves of the Caribbean Sea and the sounds of the breeze be the background music during your relaxation massages!</p>\r\n<p>Beauty services, from hair cuts and nail treatments, to hair styling, make up and waxing are the perfect complement to finish the experience relaxed and radiant.</p>\r\n<p>The Beauty Salon is equipped with 2 hairdressers, 2 manicure and 2pedicure stations.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Includes the following exercise equipment:</p>\r\n<ul type=\"disc\">\r\n<li>1 Elliptical Trainer</li>\r\n<li>1 Chest Press</li>\r\n<li>1 Biceps/Triceps</li>\r\n<li>1 Leg Extension</li>\r\n<li>1 Abdominal Crunch</li>\r\n<li>1 Pectoralis</li>\r\n<li>1 Traps &amp; Deltoid (Upper Back)</li>\r\n<li>1 Stairmaster</li>\r\n<li>2 Stationary Bikes</li>\r\n<li>1 Rowing Machine</li>\r\n</ul>\r\n<p>The gym and humid area are free.</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7900fb4a-03a8-11e7-8418-deadbe60ee62', 'RIU NAIBOA HOTEL', 'Hoteles Riu Playa Macao, Punta Cana, Dominican Republic', 'info.dominicanrepublic@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p align=\"justify\">&nbsp;</p>\r\n<p align=\"justify\">The Riu Naiboa Hotel does not have its own spa. <br />Nonetheless, excellent massages and hair braiding, are available at the hotel\'s garden pavilion.</p>\r\n<p align=\"justify\">&nbsp;</p>\r\n<p align=\"justify\">Riu Naiboa Hotel guests have unrestricted access to the spa next door at&nbsp; the <a href=\"https://www.renovaspa.com/abouthotel.php?id=75\">Riu Palace Bavaro.</a></p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p><strong><span style=\"font-size: 1.17em;\"><br /><br /></span></strong></p>\r\n<p><strong><span style=\"font-size: 1.17em;\">GARDEN PAVILION</span></strong></p>\r\n<p>Do not miss a moment from the gorgeous Caribbean Garden. Relax and enjoy the sound of palm trees and nature with a unique massage at Renova Spa\'s garden pavilion.</p>\r\n<p>&nbsp;</p>\r\n<p>A broad range of spa services such as body treatments, facials and massages including specially designed packages, salon and nail services can be enjoyed at the <a href=\"https://www.renovaspa.com/abouthotel.php?id=75\">Riu Palace Bavaro&nbsp;</a> to make your vacation just unforgettable!</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('79182f2a-03a8-11e7-8418-deadbe60ee62', 'RIU NEGRIL CLUB HOTEL', 'Norman Manley Boulevard, Bloody Bay Beach, Negril, Jamaica', 'info.jamaica@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>We are located inside the Riu Negril ClubHotel.</p>\r\n<p>The Spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p><br /><br /><br /></p>\r\n<p><br /><br /><br /><br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>This Spa features one double room for all type of couples services and two single rooms, one of them including a shower for body treatments and one special room for facials.</p>\r\n<p>Customers can choose from our spa menu or special packages and enjoy the expertise of our therapists submerging in a tranquil environment created by soft lightning, island scents and music to make them feel renewed.</p>\r\n<p>The spa includes a complete beauty salon that offers hairstyle services like hair cuts, hair treatments and braiding, nail treatments and waxing services among others.</p>\r\n<p>We specialize in wedding parties and making them feel special and pampered on this unique event!</p>\r\n<p>The Beauty Salon includes:</p>\r\n<ul>\r\n<li>2 dressing tables&nbsp;</li>\r\n<li>1 hair washbasin&nbsp;</li>\r\n<li>2 manicure tables&nbsp;</li>\r\n<li>2 pedicure chairs&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Located at the beach facing the Caribbean, a wooden gazebo is available for single or couples beach massages.</p>\r\n<p>This is the perfect place to relax and enjoy your vacation at the island! As part of the all inclusive hotel services, male and female saunas and two shared jacuzzis surrounded by lush gardens are offered for all guests to enjoy.</p>\r\n<p>In addition to this, a full gym is available.</p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3>FITNESS CENTER</h3>\r\n<p>Includes the following exercise equipment:</p>\r\n<ul>\r\n<li>1 Elliptical Trainer&nbsp;</li>\r\n<li>1 Chest Press&nbsp;</li>\r\n<li>1 Biceps/Triceps&nbsp;</li>\r\n<li>1 Leg Extension&nbsp;</li>\r\n<li>1 Abdominal Crunch&nbsp;</li>\r\n<li>1 Pectoralis&nbsp;</li>\r\n<li>1 Traps &amp; Deltoid (Upper Back)&nbsp;</li>\r\n<li>1 Stairmaster&nbsp;</li>\r\n<li>2 Stationary Bikes&nbsp;</li>\r\n<li>1 Rowing Machine&nbsp;</li>\r\n<li>Yoga mats&nbsp;</li>\r\n<li>Pilates balls&nbsp;</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('792eef22-03a8-11e7-8418-deadbe60ee62', 'RIU OCHO RIOS HOTEL', 'Riu Club Hotel Ocho<br>Rios Mammee Bay<br>St. Ann - Ocho Rios - Jamaica', 'info.jamaica@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>We\\\'re located inside the Riu Ocho Rios ClubHotel</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p><br /><br /><br /><br /><br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>This beautiful Spa features different locations for you to enjoy all type of massages, body treatments and facials.</p>\r\n<p>&nbsp;</p>\r\n<p>Two single treatment rooms and two double rooms for couples treatments are located inside the spa surrounded by a tranquil atmosphere.</p>\r\n<p>Our garden pavilion, located close to the relaxation area, offers 2 to 4 spaces to enjoy a massage with your friends or beloved one.<br />Two beautiful wooden beach pavilions offer single or couples&acute; services with an incredible ocean view.</p>\r\n<p>If you wish to be closer to the ocean, we also offer massages directly on the beach. Let the breeze be the background music during your relaxation massages!<br />We also offer manicure and pedicure services surrounded by our gardens and a full beauty salon with 3 hair stations, where our expert stylists will make you look perfect and pamper you.</p>\r\n<p>A special braiding station is available at the beach area as well. Weddings and groups are our specialty.</p>\r\n<p>Enjoy our beauty salon and spa, and look radiant during your holidays! To wrap up your spa experience, before or after any spa treatment, Renova Spa features a relaxation area, where you will be able to enjoy two Jacuzzis and also a steam room located inside the changing rooms for ladies and gentlemen respectively.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Includes the following exercise equipment:</p>\r\n<ul>\r\n<li>1 Elliptical Trainer&nbsp;</li>\r\n<li>1 Chest Press&nbsp;</li>\r\n<li>1 Biceps/Triceps&nbsp;</li>\r\n<li>2 Leg Extension Machines&nbsp;</li>\r\n<li>1 Abdominal Crunch&nbsp;</li>\r\n<li>1 Pectoralis&nbsp;</li>\r\n<li>1 Stairmaster&nbsp;</li>\r\n<li>2 Nautilus Stairmaster Freeclimber&nbsp;</li>\r\n<li>2 Spinning Bikes&nbsp;</li>\r\n<li>2 Stationary Bikes&nbsp;</li>\r\n<li>2 Rowing Machines&nbsp;</li>\r\n<li>1 Treadmill&nbsp;</li>\r\n<li>1 Nautilus Commercial Treadmill&nbsp;</li>\r\n<li>Yoga mats&nbsp;</li>\r\n<li>Pilates balls&nbsp;</li>\r\n</ul>\r\n<p>The gym and the humid area are free to be used by all hotel guests.&nbsp;</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('79475863-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE ANTILLAS', 'J.E. Irasquin Blvd 77 Palm Beach, Aruba.', 'info.aruba@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>We&rsquo;re located inside the Riu Palace Antillas.</p>\r\n<p><br /> The spa will not be able to make reservations for you by phone.</p>\r\n<p>The Fitness Centre is open from 7:00 am to 8:00 pm.</p>\r\n<p>We do not close at any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<br /><br /><br /></p>\r\n<p><br /><br /></p>\r\n<h3>SPA FACILITIES<br /><br /></h3>\r\n<p style=\"text-align: justify;\">This elegant and modern Spa features different locations for you to enjoy all type of massages, body treatments and facials.<br /><br /></p>\r\n<p style=\"text-align: justify;\">Two single treatment rooms and four double rooms for couple treatments are located inside the spa surrounded by a tranquil atmosphere.<br /><br /></p>\r\n<p style=\"text-align: justify;\">Check out our Spa programs for singles or couples and have a spa experience as part of an unforgettable vacation!</p>\r\n<p style=\"text-align: justify;\">One beautiful beach pavilion offers massages with an incredible ocean view during daytime or at night. <br /><br />Let the breeze be the background music during your relaxation massages!<br /><br /></p>\r\n<p style=\"text-align: justify;\">We also offer manicure and pedicure services and a full beauty salon, <br />whereour expert stylists will make you look perfect and pamper you.<br /><br /></p>\r\n<p style=\"text-align: justify;\">To wrap up your spa experience, before or after any spa treatment, Renova Spa features a steam room located inside the changing rooms for ladies and gentlemen respectively. <br /><br />These facilities in conjunction with the gym are available free of charge for guests of the all-inclusive program.<br /><br /></p>\r\n<p>&nbsp;The salon equipment includes:</p>\r\n<ul>\r\n<li>3 dressing tables</li>\r\n<li>1 hair washbasin</li>\r\n<li>2 manicure tables</li>\r\n<li>2 pedicure stations</li>\r\n</ul>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h3>FITNESS CENTER</h3>\r\n<p><span>The gym includes the following</span>&nbsp;exercise equipment:&nbsp;</p>\r\n<ul type=\"disc\">\r\n<li>mats&nbsp;</li>\r\n<li>pilates balls</li>\r\n<li>free weights</li>\r\n<li>2 abdominal crunches</li>\r\n<li>2 cross-trainers</li>\r\n<li>1 squat</li>\r\n<li>1 seated leg curl</li>\r\n<li>1 chest press</li>\r\n<li>1 pull down</li>\r\n<li>1 leg extension</li>\r\n<li>2&nbsp;95 R Lifecycle Bikes</li>\r\n<li>4&nbsp;x 95 X&nbsp;Eliptics</li>\r\n<li>5 Treadmills 5 x 95T</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7961ce45-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE ARUBA', 'J. E. Irasquin Blvd 79 Palm Beach, Aruba', 'info.aruba@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We&rsquo;re located inside the Riu Palace Aruba.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>The Fitness Centre is open from 7:00 am to 8:00 pm.</p>\r\n<p>We do not close at any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><br /><br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>A broad range of spa services such as body treatments, facials and massages including specially designed packages are offered at this elegant spa in five treatment rooms, one of which is double for couples\\\' treatments to make your vacation just unforgettable!</p>\r\n<p>You can make the most of your Caribbean spa experience by taking massages in our beautiful gazebo overlooking the ocean.</p>\r\n<p>&nbsp;</p>\r\n<p>Here you can enjoy our experienced therapists&acute; skills, and just relax!<br /><br /></p>\r\n<p>Before or after any spa treatment, Renova Spa features a lounge area, <br />where you will be able to enjoy a jacuzzi and also a sauna located inside the changing rooms for ladies and gentlemen respectively.</p>\r\n<p><br />We also offer manicure and pedicure services and a full beauty salon with 2 hair stations, where our expert stylists will pamper you.</p>\r\n<p>Look radiant during your holidays!<br /><br /></p>\r\n<p>The salon equipment includes:</p>\r\n<ul>\r\n<li>2 dressing tables</li>\r\n<li>1 hair washbasin</li>\r\n<li>2 manicure tables</li>\r\n<li>2 pedicure stationss</li>\r\n</ul>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p align=\\\"justify\\\">&nbsp;The gym includes the following exercise equipment:&nbsp;</p>\r\n<ul type=\\\"disc\\\">\r\n<li>4 Upright Lifecycle Bikes</li>\r\n<li>2 Elliptical Cross-Trainers</li>\r\n<li>3 Treadmills</li>\r\n<li>1 Abdominal Station (Leg Raises &amp; Abdominal Bench)</li>\r\n<li>1 Triceps Extension</li>\r\n<li>1 Shoulder Press</li>\r\n<li>1 Chest Press</li>\r\n<li>1 Abdominal Crunch</li>\r\n<li>1 Seated Leg Curls</li>\r\n<li>1 Leg Press</li>\r\n<li>1 Seated Rows</li>\r\n<li>1 Leg Extensions</li>\r\n<li>1 Pectoral Fly</li>\r\n<li>Free Weights from 10 to 50 pounds</li>\r\n<li>Yoga and Floor Mats</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('797da884-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE BAVARO', 'Hoteles Riu, Playa Macao, Punta Cana, Dominican Republic', 'info.dominicanrepublic@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We\\\'re located inside Riu Palace Bavaro Hotel in Punta Cana.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p><br /><br /><br /><br /><br /><br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>To be used by guests from Riu Palace Bavaro, Riu Palace Macao, Riu Palace Punta Cana, Riu Naiboa and Riu Bamb&uacute;.<br />With its 450 square meters extension, this Renova Spa is located at the Riu Palace Bavaro.</p>\r\n<p>&nbsp;</p>\r\n<p>A broad range of spa services such as body treatments, facials and massages are offered in the six treatment rooms, two of which are double for couple treatments.</p>\r\n<p>&nbsp;</p>\r\n<p>The spa has a modern beauty salon offering high-quality full services such as haircuts, settings, different types of manicures and pedicures, among others. <br /><br />The salon is equipped with:</p>\r\n<ul>\r\n<li>2 hairstyle stations&nbsp;</li>\r\n<li>2 luxurious pedicure chairs&nbsp;</li>\r\n<li>2 manicure tables&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Nature lovers will find the perfect place to relax in our two beach pavilions and our garden pavilion, offering massage and hair braid services.</p>\r\n<p>Let the waves of the Caribbean Sea and the sounds of the breeze be the background music during your relaxation massages!</p>\r\n<p>We have spa programs that will make your vacation just unforgettable!</p>\r\n<p>&nbsp;</p>\r\n<p>For guests from Riu Palace Hotels only:</p>\r\n<p>To wrap up your spa experience, before or after any spa treatment, Renova Spa features a relaxation area, where you will be able to enjoy two pools, one with hot and one with cold water and also a steam room located inside the changing rooms for ladies and gentlemen respectively.</p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>The Fitness&nbsp;Center includes the following exercise equipment:</p>\r\n<ul>\r\n<li>3 Treadmills&nbsp;</li>\r\n<li>1 Exercise bike&nbsp;</li>\r\n<li>2 Elliptic trainers&nbsp;</li>\r\n<li>1 Stepper&nbsp;</li>\r\n<li>1 Leg machine (calf, gluteus, legs)&nbsp;</li>\r\n<li>1 Shoulder, biceps and triceps machine&nbsp;</li>\r\n<li>1 Press chest machine&nbsp;</li>\r\n<li>1 Back machine&nbsp;</li>\r\n<li>1 Universal bench&nbsp;</li>\r\n</ul>\r\n<p>The gym and humid area is free.&nbsp;</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('79a565a7-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE CABO SAN LUCAS HOTEL', 'Camino viejo a San Jose s/n,<br>Carretera Transpeninsular km 3.5.<br> Colonia el medano, Cabo San Lucas, Baja CaliforniaSur.CP: 23453', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We&rsquo;re located inside the Riu Palace Cabo San Lucas Hotel.</p>\r\n<p>Phone Number: (624) 146 71 60 ext.897</p>\r\n<p>Direct: (624) 105 91 85</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>This Spa is decorated with fine furniture and beautiful details. It features 5 double-rooms, one of them with bath. <br />Customers may enjoy of any massage service, body-wrap, or facial and submerge in the tranquil environment created by soft lightning and music to make them feel renewed.</p>\r\n<p>The spa includes a complete beauty salon that offers pampering services like hair cuts and treatments, nails treatments and waxing services among others.</p>\r\n<p>This is the Beauty Salon equipment:</p>\r\n<ul>\r\n<li>2 dressing tables&nbsp;</li>\r\n<li>1 hair washbasins&nbsp;</li>\r\n<li>2 manicure tables&nbsp;</li>\r\n<li>2 pedicure chairs&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Within the Spa facilities you will find a balcony with a gorgeous ocean view to the &ldquo;The Arch&rdquo;, Los Cabos natural monumental symbol. Here our guests can relax inside the Jacuzzi while contemplating the sunset.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>In addition to this, male and female sauna and the Fitness Center are part of the &ldquo;all-inclusive&rdquo; services.</p>\r\n<p>Also facing to the great Pacific Ocean the fitness center includes the following equipment:</p>\r\n<ul>\r\n<li>4 Treadmills&nbsp;</li>\r\n<li>2 Steppers&nbsp;</li>\r\n<li>3 Exercise Bikes&nbsp;</li>\r\n<li>6 weight machines for located body areas.&nbsp;</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('79eae509-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE COSTA RICA', 'Riu Hotel - Playa Matapalo Guanacaste - Costa Rica', 'info.costarica@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>We\'re located beside the Riu Guanacaste Hotel.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>&nbsp;</p>\r\n<p>The Fitness Centre is open from 7:00 am to 8:00 pm.</p>\r\n<p>We do not close at any holidays.</p>\r\n<p><br /><br /><br /><br /><br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>The Renova SPA features 8 treatment rooms, 5 of which are double for couple services, plus a special area for Shiatsu Massages.</p>\r\n<p>Do not miss a moment in the gorgeous and relaxing outdoors location with an exquisite ocean breeze!</p>\r\n<p>Relax and enjoy an unique massage at Renova Spa\'s garden pavilion.</p>\r\n<p>Guests of the hotel will enjoy the benefits of a modern wet area facility containing a steam room and a beautiful jacuzzi located in a spacious indoor area, equipped with chaises that invite you to lounge before or after your spa treatments.</p>\r\n<p>The spa building also contains a modern beauty salon offering manicures, pedicures, haircuts and hair removal treatments, among many others.<br /><br /></p>\r\n<p>The salon equipment includes:</p>\r\n<ul type=\"disc\">\r\n<li>2 dressing tables</li>\r\n<li>1 hair washing station</li>\r\n<li>3 manicure tables</li>\r\n<li>2 pedicure chairs</li>\r\n<li>salon retail area</li>\r\n</ul>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Includes the following exercise equipment:</p>\r\n<ul type=\"disc\">\r\n<li>2 Treadmills</li>\r\n<li>4 Elliptic Trainers</li>\r\n<li>4 Upright Bike</li>\r\n<li>1 Spinning Bike</li>\r\n<li>1 Leg Extension/Leg Curl Multi Gym</li>\r\n<li>1 Chest Press</li>\r\n<li>1 Shoulder Press</li>\r\n<li>1 Seated Row</li>\r\n<li>1 Adjustable Decline/Abdominal Crunch</li>\r\n<li>Yoga Mats</li>\r\n<li>Pilates Balls</li>\r\n<li>Steps</li>\r\n<li>Free Weights (3.30 to 30 pounds)</li>\r\n</ul>\r\n<p>The gym and the humid area are free.</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7a06489b-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE JAMAICA', 'Mahoe Bay - Rose Hall - Ironshore P.O.Montego Bay - Jamaica', 'info.jamaica@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p><br /><br /><br /><br /><br /><br /><br /><br /><br /></p>\r\n<h3>ABOUT SPA</h3>\r\n<p>&nbsp;</p>\r\n<p>The Hotel Riu Palace Jamaica does not offer an in-house spa.<br /> Massages and hair braids services are available at the beach&nbsp;pavillion&nbsp;and a gym is featured in&nbsp;house.<br />Additionally, Riu Palace Jamaica guests have access to the spa at the <a href=\"https://www.renovaspa.com/abouthotel.php?id=39\">Riu Montego Bay</a> which is located within walking distance.</p>\r\n<p>&nbsp;</p>\r\n<p>Do not miss a moment from the gorgeous Caribbean Ocean view. Relax and enjoy the sound of the ocean breeze with a unique massage at Renova Spa\'s beach pavilion.</p>\r\n<p>&nbsp;</p>\r\n<p>You can also enjoy our spa treatments and salon services, such as Body Wraps, Massages, Facials, Waxing, Nail treatments and Special Packages, at: Riu Montego Bay.</p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Includes the following exercise equipment:</p>\r\n<ul>\r\n<li>3 Treadmills&nbsp;</li>\r\n<li>1 Stationary Bicycle&nbsp;</li>\r\n<li>1 Elliptical Trainer&nbsp;</li>\r\n<li>1 Bench Press&nbsp;</li>\r\n<li>1 Total Gym Free Weights (from 5lbs to 50lbs sets in increments of 5lb)&nbsp;</li>\r\n<li>Yoga Mats&nbsp;</li>\r\n</ul>\r\n<p>The gym and humid area is free.</p>\r\n<p>&nbsp;</p>', 1, '2017-03-07 00:00:00', 0, 0, 0);
INSERT INTO `hotel` (`id`, `name`, `address`, `notify_email`, `customer_service_name`, `open_at`, `closed_At`, `description`, `enabled`, `created`, `is_deleted`, `discount`, `active_discount`) VALUES
('7a1d54fb-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE LAS AMERICAS HOTEL', 'Boulevard Kukulcán Km. 8.5<br> Hotel Zone - Cancun<br>Quintana Roo, Mexico, CP 77500<br>', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>We&rsquo;re located inside the Riu Palace Las Americas Hotel.</p>\r\n<p>&nbsp;</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We are open 365 days a year.</p>\r\n<p>&nbsp;<br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES<br /><br /></h3>\r\n<p>Luxury and refinement are words that best describe this spa in the heart of the hotel\'s swimming pool complex.</p>\r\n<p>It features 5 cabins, one of which is double sized.</p>\r\n<p>Candlelight, soft music and delicate aromas help guests to dream and relax while receiving massages, body wraps or facial treatments. <br /> The spa features a lavish beauty salon offering different types of manicure and pedicure, hair styling, haircuts and hair removal and specializes in wedding and events.</p>\r\n<p>&nbsp;<br />Beauty salon equipment:</p>\r\n<ul>\r\n<li>&nbsp;2 salon stations</li>\r\n<li>&nbsp;1 hair washing station</li>\r\n<li>&nbsp;2 manicure stations</li>\r\n<li>&nbsp;2 pedicure stations</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Our wet area is opulently decorated in Roman style and features two jacuzzis surrounded by comfortable loungers that invite further relaxation after your massage.</p>\r\n<p>All-inclusive guests may also use the sauna, lockers and gym at no extra charge.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Includes the following equipment:</p>\r\n<ul>\r\n<li>&nbsp;4 Treadmills</li>\r\n<li>&nbsp;2 Stair machines</li>\r\n<li>&nbsp;3 Stationary bicycles</li>\r\n<li>&nbsp;Weight stations</li>\r\n<li>&nbsp;Equipment for:<br />- Multipress Pectorals and Shoulders<br />- Abdominals<br />- Chest Press<br />- Lat Pulldown<br />- Leg Extension/Curl</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7a344c52-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE MACAO', 'Hoteles Riu, Playa Macao, Punta Cana, Dominican Republic', 'info.dominicanrepublic@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>&nbsp;</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays. </p>\r\n<p>&nbsp;</p>\r\n<p>The Riu Palace Macao does not offer an in-house spa. Massages and <br /> hair braids are available at the beach pavilion.</p>\r\n<p>Additionally, Riu Palace Macao guests have access to the spa at the <a href=\"https://www.renovaspa.com/abouthotel.php?id=75\"><span style=\"text-decoration: underline;\">Riu Palace Bavaro</span></a></p>\r\n<p><br /><br /><br /></p>\r\n<h3>BEACH PAVILION</h3>\r\n<p>&nbsp;</p>\r\n<p>Do not miss a moment from the gorgeous Caribbean Ocean view. <br />Relax and enjoy the sound of crashing waves with a unique massage at Renova Spa\'s beach pavilion.</p>\r\n<p>&nbsp;</p>\r\n<p>A broad range of spa services such as body treatments, facials and massages including specially designed packages, salon and nail services can be enjoyed at the <a href=\"https://www.renovaspa.com/abouthotel.php?id=75\">Riu Palace Bavaro</a> Renova Spa to make your vacation just unforgettable!</p>\r\n<p><br /><br /></p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7a4b10af-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE MEXICO HOTEL', 'Av. Xaman-ha Manzana 3 <br>Lote Hotelero 4 Fraccionamiento Playacar Playa del Carmen <br>Quintana Roo Mexico, CP 77710', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>We&rsquo;re located inside the Riu Palace Mexico Hotel.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<br /><br /></p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<h3>&nbsp;</h3>\r\n<h3>&nbsp;</h3>\r\n<p>This small, but elegant and fully refurbished spa, offers four cabins, two of which are double - sized. <br />Delicate aromas, soft music and candlelight will guide you on a calm journey while receiving massages, body wraps or facial treatments.</p>\r\n<p>Guests who like being outdoors can enjoy therapeutic massages and braiding services in our poolside pavilion and our delightful beach gazebo.</p>\r\n<p>The spa has a modern beauty salon offering the high-quality full services such as haircuts, settings, manicure and pedicure, among others.</p>\r\n<p>The salon is equipped with:</p>\r\n<ul>\r\n<li>2 dressing tables (for haircuts and styling)&nbsp;</li>\r\n<li>1 hair washing station&nbsp;</li>\r\n<li>2 manicure tables&nbsp;</li>\r\n<li>1 pedicure chair&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>The spa is adjacent to a semi-outdoor relaxation area featuring a hot and cold water Jacuzzi, and a separate steam room for ladies and gentlemen.</p>\r\n<p>These facilities in conjunction with the gym are available free of charge for guests of the all-inclusive program.</p>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>3 Treadmills&nbsp;</li>\r\n<li>2 Elliptical machines&nbsp;</li>\r\n<li>2 Exercise bikes&nbsp;</li>\r\n<li>1 Recumbent exercise bike&nbsp;</li>\r\n<li>1 Triceps press&nbsp;</li>\r\n<li>1 Shoulder press&nbsp;</li>\r\n<li>1 Chest press&nbsp;</li>\r\n<li>1 Back press&nbsp;</li>\r\n<li>1 Reclining bench&nbsp;</li>\r\n<li>3 Pilates balls&nbsp;</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7a63221d-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE PACIFICO HOTEL', 'Av. Cocoteros s/n<br>Fraccionamento Flamingos<br>Vallarta. Lote Hotelero G Bahia<br>de Banderas, Nayarit. CP 63735<br>', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />Our Spa is located inside the Riu Palace Pacifico Resort.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3>&nbsp;</h3>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>You can easily find Renova Spa as it is located downstairs the &ldquo;Peninsula&rdquo; Restaurant in the hotel.</p>\r\n<p>The facilities include one individual and six double first class massage cabins, surrounded by a relaxing aroma and illumination.</p>\r\n<p>Let your senses drive you into a pleasant journey while you enjoy our massages, body and facial treatments.</p>\r\n<p>Enjoy as well massages at the beach with a spectacular view and the relaxing sound of the crashing waves.</p>\r\n<p>The spa also features a nice beauty parlor that offers a wide range of beauty services to pamper ladies and gentlemen such as hair cuts, manicure, pedicure, hair treatments and waxing.</p>\r\n<p>The beauty parlor is equipped with:</p>\r\n<ul>\r\n<li>3 dressing tables&nbsp;</li>\r\n<li>1 hair washing station&nbsp;</li>\r\n<li>2 manicure tables&nbsp;</li>\r\n<li>2 luxurious hydro massage chairs for pedicure.&nbsp;</li>\r\n</ul>\r\n<p>Hotel guests can also obtain the benefits of using the sauna, steam room, Jacuzzi and gym. All these available free of charge.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>The gym includes the following equipment:</p>\r\n<ul>\r\n<li>2 Treadmills&nbsp;</li>\r\n<li>1 Stepper&nbsp;</li>\r\n<li>3 Stationary Bikes&nbsp;</li>\r\n<li>4 weight machines: Arm curl, shoulder press, vertical chest, abdominals, low back, and crossover with pulleys and bars.&nbsp;</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7a92ad7b-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE PENINSULA', 'Boulevard Kukulcán KM 5.5<br>Lote 6-c, Hotel Zone<br>Quintana Roo<br> Mexico, CP 77500', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>The spa is inside the Hotel Riu Palace Peninsula.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We are open 365 days a year.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<br /><br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>Surrounded by elegancy and sophisticated tranquility is the best way to describe the spa, situated next to the lobby area of the Hotel.</p>\r\n<p>The facility has seven cabins one of which is double sized. Delicate aromas, soft music and candlelight will guide you on a calm journey while receiving massages, body wraps or facial treatments. <br />Guests who like being outdoors can enjoy therapeutic massages and braiding services in our poolside pavilion or delightful beach gazebo.</p>\r\n<p>The spa has a modern beauty salon offering the high-quality full services such as haircuts, settings, manicure and pedicure, among others.</p>\r\n<p>The salon is equipped with:</p>\r\n<ul>\r\n<li>2 dressing tables (for haircuts or styling)&nbsp;</li>\r\n<li>1 hair washing station&nbsp;</li>\r\n<li>2 manicure tables&nbsp;</li>\r\n<li>2 pedicure chairs </li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>The spa is adjacent to a semi-outdoor relaxation area featuring a hot and cold water Jacuzzi, and a ladies and gentlemen steam room with a view over the Lagoon.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>These facilities in conjunction with the gym are available free of charge for guest of the all-inclusive program. The Fitness center includes the following exercise equipment:</p>\r\n<ul>\r\n<li>3 Treadmills&nbsp;</li>\r\n<li>Elliptic Trainer&nbsp;</li>\r\n<li>1 Upright Bike&nbsp;</li>\r\n<li>1 Leg Extension/Leg Curl Multi Gym&nbsp;</li>\r\n<li>1 Biceps Curl&nbsp;</li>\r\n<li>2 Triceps Extension&nbsp;</li>\r\n<li>1 Chest Press&nbsp;</li>\r\n<li>1 Seated Row&nbsp;</li>\r\n<li>1 Adjustable Decline/Abdominal Crunch&nbsp;</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7aab88ec-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE PUNTA CANA', 'Hoteles Riu, Playa Macao, Punta Cana, Dominican Republic', 'info.dominicanrepublic@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>The spa will not be able to make reservations for you by phone.<br />We do not close any holidays.<br /><br /></p>\r\n<p>&nbsp;The Riu Palace Punta Cana does not offer an in-house Renova Spa.</p>\r\n<p>All our services are offered at the <a href=\"https://www.renovaspa.com/abouthotel.php?id=75\">Riu Palace Bavaro</a> and free round trasnportation is available.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>BEACH PAVILION</strong></p>\r\n<p>Do not miss a moment from the gorgeous Caribbean Ocean view.&nbsp;<br />Relax and enjoy the sound of crashing waves with a unique massage at Renova Spa\'s beach pavilion.</p>\r\n<p>A broad range of spa services such as body treatments, facials and massages including specially designed packages, salon and nail services can be enjoyed at the <a href=\"https://www.renovaspa.com/abouthotel.php?id=75\">Riu Palace Bavaro</a> Renova Spa to make your vacation just unforgettable!</p>\r\n<p>&nbsp;</p>\r\n<p><br /><br /><br /></p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7ac4e39b-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE RIVIERA MAYA HOTEL', 'Av. Xaman-ha Manzana 9 y 10 Lote Hotelero 1<br>Fraccionamiento Playacar – Playa del Carmen.<br>Quintana Roo Mexico, CP 77710', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>We&rsquo;re located inside the Riu Palace Riviera Maya Hotel.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>This Spa interior is beautifully decorated with multicolor mosaic designs that evoke the image of an Arab mosque&rsquo;s ceiling.</p>\r\n<p>It features 5 treatment rooms, where massages services, body wraps, facials, and hydro-therapies can be performed.</p>\r\n<p>The spa also offers massages services and braids at the beach area for you to relax with the sound of the breaking waves.</p>\r\n<p>Our beauty salon has a complete menu that includes hair cuts and treatments, nails treatments and waxing services among others.</p>\r\n<p>This is the Beauty Salon equipment:</p>\r\n<ul>\r\n<li>2 dressing tables&nbsp;</li>\r\n<li>1 hair washbasins&nbsp;</li>\r\n<li>1 manicure tables&nbsp;</li>\r\n<li>1 pedicure armchair&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>The Spa facilities include an outdoor meditation area with 2 Jacuzzis. In addition to this; male and female sauna, and Fitness Center are part of the &ldquo;all-inclusive&rdquo; services.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Which includes:</p>\r\n<ul>\r\n<li>2 Treadmills&nbsp;</li>\r\n<li>1 Stepper&nbsp;</li>\r\n<li>2 Exercise Bikes&nbsp;</li>\r\n<li>1 Elliptic Trainer&nbsp;</li>\r\n<li>1 Rowing machine&nbsp;</li>\r\n<li>1 Abdominal machine&nbsp;</li>\r\n<li>1 Leg machine&nbsp;</li>\r\n<li>1 Back machine&nbsp;</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7adbf8cc-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE SAINT MARTIN', 'Riu Palace Saint Martin', 'info.saintmartin@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>&nbsp;</p>\r\n<p>We&rsquo;re located inside the Riu Palace Saint Martin.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>This spa is closed on Sunday.</p>\r\n<p><br /><br /><br /><br /><br /><br /><br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>This elegant and luxurious spa offers 3 single cabins and 2 double cabins for couples services.&nbsp;</p>\r\n<p>Indulge in a spa treatment of your choice in a cabin lit by your favorite color and then recline in our relaxation room!</p>\r\n<p>Guests who like being outdoors can enjoy therapeutic massages in our beautiful wooden gazebo by the pool.&nbsp;</p>\r\n<p>Here you can enjoy our experienced therapists&acute; skills, and just relax!</p>\r\n<p>The spa also offers high-quality salon services such as haircuts, nail treatments and waxing, among others.</p>\r\n<p>You can take the spa home, with the special products from our boutique.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>The gym is available free of charge for guests of the all-inclusive program and includes:</p>\r\n<ul>\r\n<li>4 Treadmills&nbsp;</li>\r\n<li>3 Elliptical Trainer&nbsp;</li>\r\n<li>1 Stationary Bike&nbsp;</li>\r\n<li>1 Abdominals Bench&nbsp;</li>\r\n<li>1 Shoulder Press&nbsp;</li>\r\n<li>1 Mid Rowing Machine</li>\r\n<li>1 Leg Press&nbsp;</li>\r\n<li>1 Pilates ball dumbbells yoga mats <br /><br /></li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7af3a546-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE TRES ISLAS', 'Avda. Grandes Playas 35660 - Corralejo -<br> Fuerteventura - España', 'info.canaryislands@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>&nbsp;</p>\r\n<p>We\\\'re located inside the Riu Palace Tres Islas.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>The Fitness centre is open from 8:00 am to 7:00 pm from Monday through Saturday.</p>\r\n<p>We are&nbsp;closed&nbsp;at&nbsp;Sunday.</p>\r\n<p>&nbsp;</p>\r\n<p><br /><br /></p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>At Renova Spa Riu Palace Tres Islas, the environment offers space and privacy.</p>\r\n<p>The exclusive Spa features 4 single cabins and 1 double offering a wide variety of treatments.</p>\r\n<p>Relaxing massages, rejuvenating facials and body wraps are complemented with natural elements like seaweed and aloe.</p>\r\n<p>The SPA also boasts with a fully equipped salon offering a range of hair and nail services.</p>\r\n<p>Our wet area includes an incredible sea view Jacuzzi and sauna.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>The gym is included for the client of the hotel. It includes the following exercise equipment:</p>\r\n<ul>\r\n<li>1 Rowing machine Concept 2&nbsp;</li>\r\n<li>2 Bikes BH&nbsp;</li>\r\n<li>1 Mercury Max&nbsp;</li>\r\n<li>1 Step HI POWER&nbsp;</li>\r\n<li>1 Abdo machine&nbsp;</li>\r\n<li>1 Back machine&nbsp;</li>\r\n<li>1 Leg machine <br /><br /><br /></li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7b0b5c7f-03a8-11e7-8418-deadbe60ee62', 'RIU PALACE TROPICAL BAY HOTEL', 'Norman Manley Boulevard  Bloody Bay Beach  Negril – Jamaica', 'info.jamaica@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>We are located inside the Riu Palace Tropical Bay.</p>\r\n<p>We do not close at any holidays.</p>\r\n<p><br /><br /><br /><br /><br /><br /><br /><br /><br /></p>\r\n<h3>ABOUT SPA</h3>\r\n<p>&nbsp;</p>\r\n<p>This elegant and luxuriously furbished Spa offers 3 cabins, one of which is double - sized for couples services.<br />Delicate aromas, soft music and candlelight will guide you on a calm journey while receiving massages, body wraps or facial treatments.</p>\r\n<p>Guests who like being outdoors can enjoy therapeutic massages and braiding services in our beautiful wooden gazebo facing the ocean and surrounded by ancient trees.<br />Experience the peaceful unforgettable beach location, enjoy our experienced therapists&acute; skills, and just relax!</p>\r\n<p>The spa has a modern beauty salon offering high-quality full services such as haircuts, nail treatments and waxing, among others.<br /><br /></p>\r\n<p>The salon is equipped with:</p>\r\n<ul>\r\n<li>2 dressing tables</li>\r\n<li>1 hair washing station</li>\r\n<li>3 manicure tables in the Jacuzzi area</li>\r\n<li>1 pedicure chair</li>\r\n</ul>\r\n<p><br />The spa is adjacent to a semi-outdoor relaxation area featuring a cold water Jacuzzi, and a separate steam room for ladies and gentlemen.</p>\r\n<p>These facilities in conjunction with the gym are available free of charge for guests of the all-inclusive program.</p>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;Includes the following exercise equipment:</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>2 Elliptical Trainer</li>\r\n<li>1 Chest Press</li>\r\n<li>1 Biceps/Triceps</li>\r\n<li>1 Leg Extension</li>\r\n<li>1 Climbing System</li>\r\n<li>1 Traps &amp; Deltoid (Upper Back)</li>\r\n<li>1 Stairmaster</li>\r\n<li>5 Stationary Bikes</li>\r\n<li>1 Rowing Machine</li>\r\n<li>1 Cardio master</li>\r\n<li>Yoga mats</li>\r\n<li>Pilates balls</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7b22416b-03a8-11e7-8418-deadbe60ee62', 'RIU PARADISE ISLAND HOTEL', '', 'info.bahamas@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', 'hola', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7b395b32-03a8-11e7-8418-deadbe60ee62', 'RIU PLAYA BLANCA HOTEL', 'Hotel Riu Playa Blanca - Carretera Panamericana -   Playa Blanca - Rio Hato  - Panamá.', 'info.panama@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We\'re located inside the Riu Playa Blanca hotel</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<br /><br /><br /></p>\r\n<p><strong>WOODEN PAVILION</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Next to the main pool Renova Spa has created a relaxation area beneath a cozy wooden pavilion.</p>\r\n<p>Enjoy the Pacific warm weather and the sounds of nature while receiving a wide range of relaxing massages in couple or alone.&nbsp;</p>\r\n<p>&nbsp;</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7b507f08-03a8-11e7-8418-deadbe60ee62', 'RIU PLAYACAR HOTEL', 'Av. Xaman-ha Manzana<br>3 Lote Hotelero 4<br>Fraccionamiento Playacar<br> Playa del Carmen<br>Quintana Roo México, CP 77710', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>We&rsquo;re located inside the Riu Playacar Hotel.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>This elegant and modern spa, located close to the lobby area, offers 4 cabins, one of which is double - sized for couples services.</p>\r\n<p>Check out our Spa Programs for singles or couples and have a spa experience as part of an unforgettable vacation!</p>\r\n<p>For outdoor lovers we offer massages in our beautiful wooden gazebo facing the ocean.</p>\r\n<p>Experience the unforgettable beach location, enjoy our experienced therapists&acute; skills and just relax!</p>\r\n<p>The spa has a modern beauty salon offering high-quality full services such as haircuts, nail treatments and waxing, among others.</p>\r\n<p>The salon is equipped with:</p>\r\n<ul>\r\n<li>2 dressing tables&nbsp;</li>\r\n<li>1 hair washing station&nbsp;</li>\r\n<li>2 manicure tables&nbsp;</li>\r\n<li>2 pedicure chairs&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Wedding parties can indulge in a private session at our wedding room, adjacent to the salon, featuring 2 dressing tables and 3 chaise lounges for a unique experience.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>The gym is available free of charge for guests of the all-inclusive program.</p>\r\n<ul>\r\n<li>2 Treadmills&nbsp;</li>\r\n<li>1 Elliptic Trainer&nbsp;</li>\r\n<li>1 Upright Bike&nbsp;</li>\r\n<li>1 Leg Extension/Leg Curl Multi Gym&nbsp;</li>\r\n<li>1 Seated Row&nbsp;</li>\r\n<li>1 Chest Press&nbsp;</li>\r\n<li>1 Adjustable Decline/Abdominal Crunch&nbsp;</li>\r\n<li>1 Lat- biceps-triceps-machine&nbsp;</li>\r\n<li>Yoga mats&nbsp;</li>\r\n<li>Pilates balls&nbsp;</li>\r\n<li>Free weights&nbsp;</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7b675e47-03a8-11e7-8418-deadbe60ee62', 'RIU PLAZA GUADALAJARA', 'Av. Lopez Mateos, 830<br>Fracc. Chapalita 44500', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tbody>\r\n<tr>\r\n<td class=\\\"text11\\\" valign=\\\"top\\\" width=\\\"245\\\" height=\\\"284\\\">\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>ABOUT SPA</h3>\r\n<p>&nbsp;</p>\r\n<p align=\\\"justify\\\">The Spa is located in the 1st. floor of the Riu Plaza Guadalajara Hotel.&nbsp;</p>\r\n<p align=\\\"justify\\\"><span>Renova Spa and Body Taktik open from 8:00 a.m. to 9:00 p.m. and the&nbsp;</span><span>Gym opens from 6:00 a.m. to 10:00 p.m.</span></p>\r\n<p align=\\\"justify\\\"><span>We are open 365 days a year.&nbsp;</span></p>\r\n<p align=\\\"justify\\\"><span><span class=\\\"text9\\\"><span lang=\\\"EN-US\\\" xml:lang=\\\"EN-US\\\">The spa will not be able to make reservations for you by phone.</span></span></span></p>\r\n<p align=\\\"justify\\\"><span><span class=\\\"text9\\\"><span lang=\\\"EN-US\\\" xml:lang=\\\"EN-US\\\"><br /></span></span></span></p>\r\n<p align=\\\"justify\\\"><span><span class=\\\"text9\\\"><span lang=\\\"EN-US\\\" xml:lang=\\\"EN-US\\\"><br /></span></span></span></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>Renova Spa is located on the 1st floor of the most impressive hotel in the city of Guadalajara, near the modern deck-lounge and exterior swimming pool of the new Riu Plaza Guadalajara Hotel. <br />With an eclectic style, Renova Spa invites their guests to relax after a hard day\\\'s work by enjoying its facials and body treatments as well as its relaxing massages and therapies. <br />People living in the city can also include a regular spa visit as part of a healthy lifestyle within the city.<br />In addition, Renova Spa presents through Body&nbsp;Taktik a new line of non-invasive high tech, aesthetic treatments to counteract the effects of time on the skin and reduce sizes without surgery.<br />Facilities include five treatment rooms, a beauty salon and a complete gym. Besides this, lockers, showers and sauna for men and women are part of the services our guests can enjoy.</p>\r\n<p align=\\\"justify\\\"><span><span class=\\\"text9\\\"><span lang=\\\"EN-US\\\" xml:lang=\\\"EN-US\\\"><br /></span></span></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7b7edffa-03a8-11e7-8418-deadbe60ee62', 'RIU REGGAE', 'Rosehall, Ironshore P.O., Mahoe Bay, Montego Bay, Saint James, Jamaica', 'info@renovaspa.com', 'info@renovaspa.com', '09:00:00', '18:00:00', '<p><br />We are located inside the RIU Reggae Hotel.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>The Fitness center is open from 7:00 am to 8:00 pm.</p>\r\n<p>We do not close at any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES<br /><br /></h3>\r\n<p>Renova Spa offers a luxurious relaxation oasis at the Riu Reggae.</p>\r\n<p>Our guests can choose among a broad selection of therapies to experience a unique paradise dream.</p>\r\n<p>&nbsp;</p>\r\n<p>Massages, special therapies, body and facial treatments are offered by experienced therapists in 3 single cabins or in our special double cabin.</p>\r\n<p>The facilities include a spacious wet area with a Jacuzzi to enjoy before or after our spa treatments. <br />Steam Baths are also available to enjoy a complete spa experience.</p>\r\n<p>&nbsp;</p>\r\n<p>To enjoy a unique Caribbean spa experience, the perfect place to relax is in our beach pavilion, where we offer massages.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Beauty services, from hair cuts and nail treatments, to hair styling, make up and waxing are the perfect complement to finish the experience relaxed and radiant.</p>\r\n<p>The Beauty Salon is equipped with:<br /> * 2 salon stations<br /> * 2 manicure stations<br /> * 2 pedicure station</p>\r\n<h3>&nbsp;<br /><br /></h3>\r\n<h3>FITNESS CENTER<br /><br /></h3>\r\n<p>Includes the following exercise equipment:</p>\r\n<p>pending-to be confirmed</p>\r\n<p><strong><br /></strong></p>\r\n<p>The gym and humid area are free.</p>\r\n<p>&nbsp;</p>\r\n<p><span><br /></span></p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7b961529-03a8-11e7-8418-deadbe60ee62', 'RIU REPUBLICA', 'Hoteles Riu, Playa Macao, Punta Cana, Dominican Republic', 'info.dominicanrepublic@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We\\\'re located inside Riu Rep&uacute;blica.</p>\r\n<p>The Spa will not be able to make reservations for you by phone.</p>\r\n<p>The Fitness centre is open from 9:00 am to 7:30 pm.</p>\r\n<p>We do not close at any holidays.</p>\r\n<p><br /><br /><br /><br /><br /><br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>This elegant and modern Spa features different locations for you to enjoy all type of massages, body treatments and facials.<br /> <br /> Three single treatment rooms and two double rooms for couple treatments are located inside the spa surrounded by a tranquil atmosphere.<br /> Check out our Spa programs for singles or couples and have a spa experience as part of an unforgettable vacation!<br /> <br /> Two beautiful beach pavilions offer massages with an incredible ocean view during daytime or at night.<br /> Let the breeze be the background music during your relaxation massages!<br /> <br /> We also offer manicure and pedicure services and a full beauty salon, where our expert stylists will make you look perfect and pamper you.<br /> <br /> To wrap up your spa experience, before or after any spa treatment, Renova Spa features a steam room and a Jacuzzi located inside the changing rooms for ladies and gentlemen respectively.</p>\r\n<p><br /> These facilities in conjunction with the gym are available free of charge for guests of the all-inclusive program.</p>\r\n<p>At this location we offer a very special wedding room, where brides and their guests can relax, while being pampered with nail treatments and wedding salon services.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>The salon equipment includes:</p>\r\n<ul>\r\n<li>2 dressing tables</li>\r\n<li>1 hair washbasin</li>\r\n<li>2 manicure tables</li>\r\n<li>2 pedicure stations</li>\r\n<li>2 dressing tables&nbsp;</li>\r\n<li>1 hair washbasin&nbsp;</li>\r\n<li>2 manicure stations&nbsp;</li>\r\n<li>1 pedicure station&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Fitnesse Centre The gym includes the following exercise equipment:</p>\r\n<ul>\r\n<li>2 Treadmills with Led monitor and USB&nbsp;</li>\r\n<li>2 Exercise Bikes with Led monitor and USB&nbsp;</li>\r\n<li>1 Elliptic trainer with Led monitor and USB&nbsp;</li>\r\n<li>1 Multi Gym Station: Gym Ball/Stability Ball&nbsp;</li>\r\n<li>7 Localized Strenght Equipments</li>\r\n<li>1 Set of Medicine Balls&nbsp;</li>\r\n<li>1 High Quality Kettle Bell&nbsp;</li>\r\n<li>High Quality rubberized dumbbells with chrome bar&nbsp;</li>\r\n<li>Yoga Mats Fitness Matt&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>The gym and humid area are free.</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7baec999-03a8-11e7-8418-deadbe60ee62', 'RIU SANTA FE HOTEL', 'Camino viejo a San Jose s/n,<br>Carretera Transpeninsular km 3.5.<br> Colonia el medano,<br> Cabo San Lucas, Baja California<br>Sur.CP: 23453', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>We&rsquo;re located inside the Riu Santa Fe Hotel</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<br /><br /></p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>This spa is perfectly blended with the desert landscape that prevails in the Baja California area. Its Mexican decoration with clay pottery and sculptures gives it an antique but luxurious air.</p>\r\n<p>It features 7 treatment rooms all of them double where massage services, body-wraps and facials can be given.</p>\r\n<p>The spa includes a complete beauty salon that offers pampering services like hair cuts and treatments, nails treatments and waxing services among others.</p>\r\n<p>This is the Beauty Salon equipment:</p>\r\n<ul>\r\n<li>3 dressing tables&nbsp;</li>\r\n<li>1 hair washbasins&nbsp;</li>\r\n<li>3 manicure tables&nbsp;</li>\r\n<li>3 pedicure chairs over a wooden platform&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Within the spa facilities lie a typical Mexican &ldquo;Patio&rdquo;: outdoor area with ceramic floor and a beautiful circular fountain in the center.</p>\r\n<p>Here you can find Jacuzzis to enjoy a hydro massage before or after your service. In addition to this; male and female sauna and Fitness Center are part of the &ldquo;all-inclusive&rdquo; services.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>The fitness center has a great window that allows the light to illuminate the area during the day.</p>\r\n<p>It includes the following equipment:</p>\r\n<ul>\r\n<li>3 Treadmills&nbsp;</li>\r\n<li>1 Steppers&nbsp;</li>\r\n<li>1 Exercise Bikes&nbsp;</li>\r\n<li>3 Elliptic Trainers</li>\r\n<li>1 Leg Machine&nbsp;</li>\r\n<li>2 Chest Machines&nbsp;</li>\r\n<li>1 Row Machine&nbsp;</li>\r\n<li>1 Biceps Machine&nbsp;</li>\r\n<li>1 Abdo Machine&nbsp;</li>\r\n<li>1 Triceps Machine&nbsp;</li>\r\n<li>1 Roman Bench 45&deg;&nbsp;</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7bc6888e-03a8-11e7-8418-deadbe60ee62', 'RIU SRI LANKA', 'Ahungalla Beach, Bentota Walallawita korale<br>Galle District, Ahungalla 80500', 'info@renovaspa.com', 'info@renovaspa.com', '09:00:00', '18:00:00', '<p><span><span>For additional information,&nbsp; please write to <a href=\"mailto:info.srilanka@renovaspa.com\">info.srilanka@renovaspa.com</a></span></span></p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>This modern spa includes 4 spa cabins to enjoy our treatments in an atmosphere of sophistication and tranquility.</p>\r\n<p>&nbsp;</p>\r\n<p>2 of the cabins are double-sized for couples treatments and<br />2 include a massage table and a tatami for our special selection of oriental massages.</p>\r\n<p>If you wish to have a different spa experience, we recommend you to enjoy the massages at our beach pavilion facing the ocean.</p>\r\n<p>&nbsp;</p>\r\n<p>Renova Spa Sri Lanka features a relaxation area, where you will be able to enjoy a hot and a cold water jacuzzi, steam rooms located inside the changing<br /> rooms for ladies and gentlemen respectively and lounge chairs to enjoy a hot or cold drink.</p>\r\n<p>&nbsp;</p>\r\n<p>The spa has a modern beauty salon offering nail treatments, salon services and special services for weddings or events,<br />including traditional Sri Lankan wedding make-up and dress-up.</p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>The salon is equipped with:</p>\r\n<ul>\r\n<li>2 dressing tables</li>\r\n<li>1 make up chair</li>\r\n<li>1 hair washing station</li>\r\n<li>1 manicure table</li>\r\n<li>2 pedicure chairs</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>Includes the following exercise equipment:</p>\r\n<ul>\r\n<li>2 Cross trainers</li>\r\n<li>2 Treadmills</li>\r\n<li>1 Upright Bike</li>\r\n<li>1 Recumbent Bike</li>\r\n<li>1 Stretch Partner</li>\r\n<li>1 Chest Press</li>\r\n<li>1 Shoulder Press</li>\r\n<li>1 Pull Down</li>\r\n<li>1 Leg Extension</li>\r\n<li>1 Leg Curl</li>\r\n</ul>\r\n<p>The gym and humid areas are free of charge.</p>\r\n<p>&nbsp;</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7bddca0b-03a8-11e7-8418-deadbe60ee62', 'RIU TEQUILA CLUBHOTEL', 'Av. Xaman-ha Manzana3 – Lote Hotelero 1<br>Fraccionamiento Playacar Playa del CarmenQuintana Roo<br>Mexico, CP 77710', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We&rsquo;re located inside the Riu Tequila ClubHotel.&nbsp;</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>The Hotel Riu Tequila does not offer an in-house spa, but massages, hair braids and nail treatments such as manicure and pedicure are available at the poolside pavilion.</p>\r\n<p>Additionally, Riu Tequila guests have full access to the spa in the <a href=\"https://www.renovaspa.com/abouthotel.php?id=53\">Riu Yucat&aacute;n</a> located across the street.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ECO-MASSAGE PAVILLION</strong></p>\r\n<p>Next to the main pool Renova Spa has created a relaxation area beneath a cozy wooden pavilion. <br />Enjoy the Caribbean warm weather and the sounds of nature while receiving a relaxing massage in couple or alone. <br />Nail treatments and hair braiding are also available to get the perfect look under the sun.</p>\r\n<p>Facilities:</p>\r\n<ul>\r\n<li>2 Massage tables&nbsp;</li>\r\n<li>1 Manicure table&nbsp;</li>\r\n<li>2 manicure tables&nbsp;</li>\r\n<li>1 Pedicure armchair</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7bf817fa-03a8-11e7-8418-deadbe60ee62', 'RIU TOUAREG HOTEL', 'Hotel Riu Touareg, Urbanizacao Lacacao. Lote 13<br>Praia Lacacao. Santa Monica. Boavista, Cabo Verde.', 'info.capeverde@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We are located inside the Riu&nbsp;Touareg Hotel.<br />The spa will not be able to make reservations for you by phone.</p>\r\n<p>The Fitness Centre is open from 8:00 am to 8:00 pm.</p>\r\n<p>We do not close at any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<br /><br /></p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>The Boa Vista Renova SPA is located inside the Hotel Riu Touareg.<br /><br /></p>\r\n<p>The island of Boa Vista, the third-largest of the archipelago and the nearest to Africa, surprises visitors with its dune-littered landscape, small oases of palm trees and extensive&nbsp;unspoiled beaches.<br /><br /></p>\r\n<p>The spa mingles with nature and is as much an outdoor experience, as it is an indoor one. <br /><br /><br />Before your treatment, relax in the scenic sea view jacuzzi and indulge in a massage by the famous Cape Verde Combination massage.<br /><br /></p>\r\n<p>The Spa offers facials for her and for him, body treatments and a complete beauty salon with a menu that includes haircut and hair treatments, manicure and pedicure...<br /><br /></p>\r\n<p>The ideal place for relaxation, inspiration and sublime indulgence.</p>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Includes the following exercise equipment:</p>\r\n<ul type=\\\"disc\\\">\r\n<li>2 Treadmills</li>\r\n<li>2 Ellipticals</li>\r\n<li>3 Stationary bikes</li>\r\n<li>1 Stept</li>\r\n<li>1 Rowiing machine</li>\r\n<li>Multi station trainer</li>\r\n<li>Free weights set from 2 Kg up to 20Kg.</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7c0f8adb-03a8-11e7-8418-deadbe60ee62', 'RIU VALLARTA HOTEL', 'Av Cocoteros s/n Fraccionamento<br> Flamingos Nallarta - Nuevo Vallarta,<br>  Nayarit. CP 63732<br>  ', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />The Spa is located in front of the main theater, nearby &ldquo;Don Rafael&rdquo; restaurant.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<br /><br /></p>\r\n<h3>&nbsp;<br /><br /></h3>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>Our facilities include 6 first-rate treatment rooms, including one couples&rsquo; treatments room with a hydro-bath. We also offer massages at the beach with a wonderful ocean view and sea sounds.</p>\r\n<p>The characteristic aroma and relaxing music creates the ideal environment to take you into a pleasure journey while getting a massage, body-wrap or facial service.</p>\r\n<p>The spa includes an agreeable beauty salon that offers pampering services like hair cuts and treatments, nail treatments and waxing services among others.</p>\r\n<p>Our Beauty Salon equipment:</p>\r\n<ul>\r\n<li>2 dressing tables&nbsp;</li>\r\n<li>1 hair washbasins&nbsp;</li>\r\n<li>2 manicure tables&nbsp;</li>\r\n<li>2 pedicure deluxe armchairs.&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Within the Spa facilities lies a luxurious hydro-therapy bathing area where 2 Jacuzzis are the main element surrounded by elegant deck chairs for guests to lounge before or after their spa treatments.</p>\r\n<p>In addition to this; locker and shower rooms, male and female sauna and Fitness Center are part of the &ldquo;all-inclusive&rdquo; services.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>The fitness gym includes the following equipment:</p>\r\n<ul>\r\n<li>2 Treadmills&nbsp;</li>\r\n<li>1 Stepper&nbsp;</li>\r\n<li>2 Exercise Bikes&nbsp;</li>\r\n<li>6 weight machines including one leg extension, an arm curl, one shoulder press, a &ldquo;T&rdquo; row, vertical chest, an abdominal and lower-back weight machine and a crossover-like pulleys with two single-hand grips&nbsp;</li>\r\n</ul>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7c266cee-03a8-11e7-8418-deadbe60ee62', 'RIU YUCATAN HOTEL', 'Av. Xaman-ha Manzana 3<br>Lote Hotelero 1, Fraccionamiento Playacar Playa del Carmen, <br>Quintana RooMexico, CP 77710.', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We&rsquo;re located inside the Riu Yucatan Hotel.&nbsp;<br />We serve Riu Yucatan`s and Riu Tequila`s guests.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>This modern and fully refurbished spa offers five indoor cabins, two of which are double - sized for special couple&rsquo;s services.</p>\r\n<p>Delicate aromas, soft music and candlelight will guide you on a calm journey while receiving massages, body wraps or facial treatments. <br />The Spa has a beauty salon offering high-quality full services, such as haircuts, settings and nail treatments, among others.</p>\r\n<p>The salon is equipped with:</p>\r\n<ul>\r\n<li>3 dressing tables&nbsp;</li>\r\n<li>1 hair washbasins&nbsp;</li>\r\n<li>3 manicure tables&nbsp;</li>\r\n<li>2 hydrotherapy pedicure armchairs&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>GARDEN PAVILION</strong></p>\r\n<p>Guests who like being outdoors can enjoy therapeutic massages in our poolside pavilion at the lounge area.</p>\r\n<p>Enjoy the Caribbean warm weather while receiving a relaxing massage in couple or alone!</p>\r\n<p>&nbsp;</p>\r\n<p><strong>BEACH-MASSAGE PAVILIONS</strong></p>\r\n<p>You can find two beautiful wooden constructions at the beach, where massage services and braids are offered. Relax with the sound of the breaking waves as background!</p>\r\n<p>Don&acute;t miss the ocean view and enjoy a relaxing experience!</p>\r\n<p>The Spa facilities also include male and female saunas and a Fitness Center as part of the &ldquo;all-inclusive&rdquo; services.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>The fitness gym includes the following equipment:</p>\r\n<ul>\r\n<li>2 Elliptic Trainer</li>\r\n<li>1 Rowing Machine</li>\r\n<li>2 Exercise Bikes</li>\r\n<li>1 Recumbent Exercise Bike</li>\r\n<li>1 Stepper</li>\r\n<li>2 Treadmills</li>\r\n<li>1 Shoulder Press</li>\r\n<li>1 Chest Press</li>\r\n<li>1 Back Press</li>\r\n<li>1 Multi-Gym for Back and Arms</li>\r\n<li>2 Universal benches</li>\r\n<li>Dumbbell rack from 5lb to 50 lb</li>\r\n<li>1 Reclining Bench</li>\r\n<li>1 Leg Press</li>\r\n<li>Yoga Mats</li>\r\n</ul>\r\n<p>&nbsp;</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7c3d995a-03a8-11e7-8418-deadbe60ee62', 'VIVA WHYNDHAM AZTECA', 'Av. Xaman-ha – Lote hotelero 8,<br> Fraccionamiento Playacar, <br> Playa del Carmen, Q. Roo, <br> México CP. 77710. ', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p>We&rsquo;re located inside the Riu Palace Mexico Hotel.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>This is a small but complete spa that features 1 treatment room, where massage services, body-wraps, or facials can be given.</p>\r\n<p>The spa includes a beauty salon that offers the complete services such as hair cuts and treatments, nails treatments and waxing services among others.</p>\r\n<p>&nbsp;</p>\r\n<p>This is the Beauty Salon equipment:</p>\r\n<ul>\r\n<li>1 dressing table</li>\r\n<li>1 hair washbasin</li>\r\n<li>1 manicure table</li>\r\n<li>1 pedicure armchair</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>At the hotel&rsquo;s pool area, you will find a beautiful wooden outdoor construction where our therapists offer massages services and braids. <br />You do not need to miss the ocean view to enjoy a relaxing experience!</p>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Under hotel&rsquo;s management</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('7c549212-03a8-11e7-8418-deadbe60ee62', 'VIVA WYNDHAM MAYA', 'Av. Xaman-ha – Lote hotelero 5,  Fraccionamiento Playacar, <br>Playa del Carmen, Q. Roo, México CP. 77710', 'info.mexico@renovaspa.com', 'Paula Casas', '09:00:00', '18:00:00', '<p><br />We&rsquo;re located inside the Viva Wyndham Maya hotel.</p>\r\n<p>The spa will not be able to make reservations for you by phone.</p>\r\n<p>We do not close&nbsp;at&nbsp;any holidays.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>SPA FACILITIES</h3>\r\n<p>&nbsp;</p>\r\n<p>This palm tree roofed Spa has 4 treatment rooms decorated with natural fresh details that create a cozy and relaxing atmosphere to have massage services, body-wraps, or facials. <br />One of the rooms features a bathing tub for soothing therapeutic baths.</p>\r\n<p>At the hotel&rsquo;s pool area, you will find a beautiful white tent where our therapists offer massages services and braids. <br />You do not need to miss the ocean view to enjoy a relaxing experience!</p>\r\n<p>The spa includes a beauty salon that offers the complete services such as hair cuts and treatments, nails treatments and waxing services among others.</p>\r\n<p>This is the Beauty Salon equipment:</p>\r\n<ul>\r\n<li>2 dressing tables</li>\r\n<li>1 hair washbasins</li>\r\n<li>1 manicure tables</li>\r\n<li>1 pedicure deluxe armchair with hydro-massage.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>An outdoors terrace at the back of the Spa features two Jacuzzis and a lounging area to relax before or after the spa treatment. <br />In addition to the Jacuzzi, male and female steam rooms are part of the &ldquo;all-inclusive&rdquo; services.</p>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h3>FITNESS CENTER</h3>\r\n<p>&nbsp;</p>\r\n<p>Under hotel&rsquo;s management</p>', 1, '2017-03-07 00:00:00', 0, 0, 0),
('f9a4f178-f870-11e6-a12a-f46e471cb539', 'RIU FUNANA CLUB HOTEL', 'Hotel Riu Touareg - Urbanizacao Lacacao. Lote 13 Praia Lacacao. Santa Monica.Boavista.Cabo Verde', 'info.capeverde@renovaspa.com', 'Paula Casas', '08:00:00', '20:00:00', '\nWe are located inside the Riu Funana Club Hotel. \nThe spa will not be able to make reservations for you by phone.\n\nThe Fitness Centre is open from 7:00 am to 8:00 pm.\n\nWe do not close at any holidays.\n\n\n\n\n\n\n\n\nSPA FACILITIES\n\n \n\nThis Renova SPA services the Riu Funana and Riu Palace Cabo Verde guests and has been designed exclusively for your relaxation and totally well-being.\n\nWith an extensive menu of services that makes it simple to get yourself renewed and radiant, from the moment you enter you are swept into a sanctuary, where your spirit is restored and your energy is revitalized.\n\n\nThe Renova SPA at Sal Island features 8 treatment rooms to offer Body Treatments, Facials, Massages and a wide range of packages and special combos for a delightful vacation.\n\n3 of these are double sized to offer services for couples.\n\nBefore or after any spa treatment, Renova Spa features a lounge area, where you will be able to enjoy a jacuzzi and beautiful terrace.\n\nThere are steam rooms at the changing rooms for ladies and gentlemen respectively.\n\n\nWe also offer a special pedicure cabin and a full beauty salon with 3 hair stations and 3 manicure stations where our expert stylists will pamper you.\n\n\nLook radiant during your holidays!\n\nThe salon equipment includes:\n\n3 dressing tables\n1 hair washbasin\n3 manicure tables\n2 pedicure stations\n \n\n \n\n \n \n \nFITNESS CENTER\n\n \n\nIncludes the following exercise equipment:\n\n3 Treadmills\n3 Elipticals\n3 Stationary bikes\n3 Upper body trainers\n2 lower body trainers\n1 Stretching trainer', 1, '2017-02-21 00:00:00', 0, 0, 0);
