('1a6c3154-0731-11e7-af99-a53d429215b4', '1a6670b6-0731-11e7-af99-a53d429215b4', '25 min', 'This natural exfoliation eliminates dead cells, dry skin and impurities deposited on\r\nthe epidermal surface. Helps to reduce cutaneous aging by stimulating blood\r\nflow.    ', 1, 0, 0, '08:00:00', '18:00:00'),
('1a6d2262-0731-11e7-af99-a53d429215b4', '1a6ccd3a-0731-11e7-af99-a53d429215b4', '50 min', 'Retrieve the natural hydration of the skin by filtering seaweed rich in vitamins and minerals that help to\r\nkeep the necessary water on your skin. Suitable for all skin types and ideal treatment after sun repair.\r\nYour skin will be more natural and healthy.\r\n ', 0, 0, 0, '08:00:00', '18:00:00'),
