('1a71afa8-0731-11e7-af99-a53d429215b4', '1a715206-0731-11e7-af99-a53d429215b4', '80 min', 'Restores purity and offers a healthy appearance to your facial skin with the help of specific special active ingredients for your type of skin. It cleanses your face of excess oils and restores a smooth, silky look to the skin.    ', 0, 0, 0, '08:00:00', '18:00:00'),
