('20cc4dd6-0731-11e7-af99-a53d429215b4', '20cb9f94-0731-11e7-af99-a53d429215b4', '60 min', 'A soft therapy technique that eliminates toxins and excess fluids form the body by\r\nstimulating the lymphatic system, natural cleansing that promotes a feeling of well being.\r\nThis is a great treatment for pregnant ladies or people who suffer from inflammation. ', 1, 0, 0, '08:00:00', '18:00:00'),
('20cd8106-0731-11e7-af99-a53d429215b4', '20cd12a2-0731-11e7-af99-a53d429215b4', '80 min', 'Enjoy this mix massage including Swedish, Deep Tissue and\r\nReflexology enhanced with soft warm pillows containing a blend\r\nof aromatic spices. A true pleasure for the senses.    ', 1, 0, 0, '08:00:00', '18:00:00'),
('20d01bc8-0731-11e7-af99-a53d429215b4', '20cf7cb8-0731-11e7-af99-a53d429215b4', '50 min', 'Zen Shiatsu stimulates the entire body with pressure and stretching\r\nmovements that help energy flow. It activates lymphatic blood\r\ncirculation; improves muscle tone and body posture while helping to\r\neliminate toxins.       ', 1, 0, 0, '08:00:00', '18:00:00'),
('20d244d4-0731-11e7-af99-a53d429215b4', '20d19f5c-0731-11e7-af99-a53d429215b4', '50 min', 'For those times when you want to wear with a luminous, radiant, firm and youthful skin, this treatment is\r\nyour perfect ally. Among its components are gold particles, hyaluronic acid, rose hip oil, argan and\r\njojoba, ruby elixir of rock crystal and laminaria seaweed and white clays. With clearly visible from its\r\napplication effects. Stretches and repairs skin, gives light, increases its firmness and elasticity and\r\nhydrates deeply . It also has an anti-free radical power. The result is a radiant skin up to any celebration.\r\n ', 0, 0, 0, '08:00:00', '18:00:00'),
('20d397da-0731-11e7-af99-a53d429215b4', '20d34712-0731-11e7-af99-a53d429215b4', '50 min', 'Vita cura\r\nThis treatment combines marine and herbal ingredients to revitalize, tighten and reaffirm flabby skin\r\nproviding an outstanding service. The treatment provides immediate rejuvenating effect on your skin.\r\nIn the long term, preserve elasticity, improve oxygenation and helps cell renewal. A papaya enzyme\r\npeeling, serum with hyaluronic acid, a mixture of antioxidants and marine biopeptides guarantee a\r\ntightening effect and stimulate the natural production of collagen, reducing fine lines. Recommended\r\nfor skins from 30 years.\r\n  ', 0, 0, 0, '08:00:00', '18:00:00');
